import React, { Component } from "react";

class GuestOrderStatus extends Component {
  render() {
    return (
      <div>
        <h3>Guest Order Status</h3>
        <table class="table">
          <thead>
            <tr>
              <th scope="col">First</th>
              <th scope="col">Last</th>
              <th scope="col">Handle</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default GuestOrderStatus;
